// Home.js
import React from 'react';
import pic from './assets/rox.jpeg';
import styled from 'styled-components';

const PageContainer = styled.div`
  height: calc(100vh - 78px);
  display: flex;
  align-items: center;
  justify-content: center;
`;

const HomeContainer = styled.div`
  display: grid;
  grid-template-columns: 100%;
  gap: 20px;
  max-width: 1200px;
  margin: 0 auto; /* Center the containers */

  @media screen and (min-width: 768px) {
    grid-template-columns: 30% 70%;
  }
`;

const InfoContainer = styled.div`
  background-color: #f2f2f2;
  border-radius: 10px;
  padding: 20px;
  text-align: center;

  @media screen and (min-width: 768px) {
    border-radius: 10px 0 0 10px;
  }
`;

const TextContainer = styled.div`
  background-color: #f5f5f5;
  border-radius: 10px;
  padding: 20px;
  text-align: center;

  @media screen and (min-width: 768px) {
    border-radius: 0 10px 10px 0;
  }
`;

const RoundedImage = styled.img`
  border-radius: 50%;
  width: 200px;
  height: 200px;
  object-fit: cover;
`;

const NameTitle = styled.p`
  font-size: 20px;
  font-weight: bold;
  margin-bottom: 10px;
`;

const Home = () => {
  return (
    <PageContainer>

      <HomeContainer>
        <InfoContainer>
          <RoundedImage src={pic} alt="Cute Cat" />
          <NameTitle>Roxana Halați</NameTitle>
          <p style={{ fontSize: '12px', marginTop: -5 }}>(like the city Galați but with an H)</p>
          <p style={{ fontSize: '16px', fontWeight:'bold',  marginTop: -3 }}>Assistant PhD</p>
          <p style={{ fontSize: '14px', marginTop: -3 }}>UBB FMI</p>
          <p style={{ fontSize: '14px', marginTop: -3 }}>roxana.halati@ubbcluj.ro</p>
        </InfoContainer>

        <TextContainer>
          <div>
            <p>Hi there!</p>
            <p>Thank you for visiting my page.</p>
            <p>What you'll find here:</p>
            <p>Info about Programming Fundamentals</p>
            <p>Schedule, Office Hours and Contact Info</p>
            <p>More info about me than you'll ever need</p>
            <p>Pictures of my pets</p>
          </div>
        </TextContainer>
      </HomeContainer>
    </PageContainer>
  );
};

export default Home;
